import React from 'react';
import { Route } from 'react-router-dom';
import { publicPages, protectedPages } from './routePages';
import ProtectedRoute from './components/ProtectedRoute';
import MainLayout from './components/MainLayout';

export const renderRoutes = () => {
  const routes = [];

  // 公共頁面
  publicPages.forEach((p) => {
    routes.push(<Route key={p.path} path={p.path} element={<p.element />} />);
  });

  // 受保護頁面
  protectedPages.forEach((p) => {
    routes.push(
      <Route
        key={p.path}
        path={p.path}
        element={
          <ProtectedRoute>
            <MainLayout>
              <p.element />
            </MainLayout>
          </ProtectedRoute>
        }
      />
    );
  });

  return routes;
};
